#
# U.S.-Korea Strategic Trade and Investment Deal (FR Doc. 2025-21940):
#
# BASELINE-FREE APPROXIMATION NOTE:
# The true policy is "15% minus Column 1 duty" (if Column 1 < 15%, combined = 15%;
# if Column 1 >= 15%, no additional reciprocal). Because this model does NOT carry
# MFN Column 1 duty by HTS line, we cannot compute (15% - base) line-by-line.
#
# We approximate by:
# - Keeping Korea's reciprocal headline rate at 0.15 (representing combined 15% total)
# - Setting civil aircraft HTS codes to 0 for Korea (explicit exemption under the deal)
#
# BIAS DIRECTION: For HTS lines where Column 1 duty >= 15%, our flat 15% total
# OVERSTATES the effective rate (true rate would be Column 1 only, no add-on).
# For HTS lines where Column 1 < 15%, our approximation is correct.
# =============================================================================

